import React from 'react';
import NowPlaying from './components/NowPlaying';
import './app.css';

function App() {
    return (
        <div className="App">
            <header>
                <h1>Tidal Now Playing</h1>
            </header>
            <main>
                <NowPlaying />
            </main>
        </div>
    );
}

export default App;
